pragma solidity 0.8.9;

library StakingLibrary {

    enum UnstakingCategories {
        REWARD_0pc,
        REWARD_30pc,
        REWARD_50pc,
        REWARD_100pc
    }

    enum MembershipCategories {
        REGULAR,
        UPGRAGE,
        PREMIUIM,
        TEAM
    }

    enum CampaignCategories {
        SILVER,
        GOLD,
        DIAMOND
    }

    struct PoolInfo {
        uint256 poolId;
        address poolAddress;
        uint256 remainingPool;
        uint256 totalTokensStaked;
        uint256 totalParicipants;
        uint256 tokenCounter;
        address poolOwner;
    }

    enum ProfileType {NONE, TEAM, USER}

    struct ProjectInfo {
        CampaignCategories category;
        string projectName;
        string projectSymbol;
        address tokenAddress;
        uint8 tokenDecimals;
        string tokenSymbol;
        ProfileType profileType;
        uint256 profileId;
    }

    struct RewardPoolInfo {
        uint256 startedAt;
